import React from 'react';

import Demo from './components/Demo'

const story = {
    title: 'Demo',
}

export default story

export const DateDemo = ({ onChange }) => (
    <Demo
        label="Please enter a date:"
        mask={[
            /\d/, /\d/, ' ', '-', ' ', /\d/, /\d/, ' ', '-', ' ', /\d/, /\d/, /\d/, /\d/
        ]}
        placeholder="DD - MM - YYYY"
        onChange={onChange}
    />
)

export const TelephoneDemo = ({ onChange }) => (
    <Demo
        label="Please enter a telephone number:"
        mask={[
            '(', /\d/, /\d/, /\d/, ')', '-', /\d/, /\d/, /\d/, '-', /\d/, /\d/, /\d/, /\d/,
        ]}
        placeholder="_"
        onChange={onChange}
    />
)

export const PostalCodeDemo = ({ onChange }) => (
    <Demo
        label="Please enter a postal code:"
        mask={[
            /[a-z]/i, /\d/, /[a-z]/i, ' ', /\d/, /[a-z]/i, /\d/, 
        ]}
        placeholder="_"
        onChange={onChange}
    />
)
